import {
  React,
  theme,
  calendarStyles,
  moment,
  ThemeProvider,
  Button,
} from "./index.js";

const DayButton = (day) => {
  const classes = calendarStyles();

  return (
    <div>
      <ThemeProvider theme={theme}>
        <Button className={classes.dayButton}>{day.day}</Button>
      </ThemeProvider>
    </div>
  );
};

export default DayButton;
